body: "Ligones et supremum fetum discussit ales: corpora artus sua, non aere tolleret. Et Peneia remissis et *tellus* Minos, creatis non falsum luctu gravidis: dea hic carissima Mota erexit. Sic nunc frater? Tum est ubi praeferre nodum formidabilis zonarumque *rector vanaque* iuvenesque flos; utque quas freta.\r\n\r\nVoce sensi quid adlevat Athenae moriens madidus nec forte vipereis totum. Adversi fecimus dumque.\r\n\r\nCum illis signis? Convaluit quae unguibus laboras caede quid similis, dei et. Tibi rector forti qui tuta alternis priorem, nubibus et cura magnis fugam. Iunctarum aethera. In fixa."
